import React, { Component } from 'react'
import Car from './Car';
let endpoint = "http://localhost:8080";
export class CarList extends Component {
    state ={
        cars:[],
    }
    componentDidMount(){
        axios.get(endpoint+"api/cars").then(res=>{
            console.log
            this.setState({cars:res.data}) ;       
        });
    }
    render() {
        return (
            <div className="container">
                <form>

                    <div className="row" style={{padding:10}}>
                        <div className="col-6">
                            <div className="card shadow-sm">
                                <input type="text" className="form-control" placeholder="Plaka"/>
                            </div>

                        </div>
                    </div>
                    <div className="row" style={{padding:10}}>
                        <div className="col-6">
                        <input type="text" className="form-control" placeholder="Marka"/>
                        </div>

                    </div>
                    <div className="row" style={{padding:10}}>
                        <div className="col-6">
                        <input type="text" className="form-control" placeholder="Model"/>
                        </div>

                    </div>

                    <button 
                    style={{margin:10}} 
                    type="submit" 
                    className="btn btn-primary"
                    onClick={this.addCar}
                    >Ekle</button>




                </form>
                 <div className="row" style={{padding:10 }}>

                <Car cars={this.cars}/>

                </div>

            </div>


        )
    }
}

export default CarList
